import React, { useState } from 'react';

const Projects = () => {
  const [activeTab, setActiveTab] = useState('government');

  const governmentProjects = [
    'Highways BT Road Construction',
    'DRDA Road Development Projects',
    'Municipality Infrastructure Development',
    'Town Panchayat Road Works',
    'Village Panchayat Connectivity Projects'
  ];

  const privateProjects = [
    'Private Layout Development',
    'Commercial Space Construction',
    'Residential Complex Roads',
    'Industrial Area Infrastructure',
    'Estate Development Projects'
  ];

  const specializedWorks = [
    'Bitumen Road Construction',
    'Drainage System Installation',
    'Culvert and Mini Bridge Construction',
    'Road Marking and Stud Installation',
    'Compound Wall Construction'
  ];

  return (
    <div className="container">
      <section className="page-section">
        <h1 className="section-title">Our Projects</h1>
        
        <div style={{ marginBottom: '2rem', textAlign: 'center' }}>
          <button 
            onClick={() => setActiveTab('government')}
            style={{
              padding: '10px 20px',
              margin: '0 10px',
              backgroundColor: activeTab === 'government' ? '#007bff' : '#f8f9fa',
              color: activeTab === 'government' ? 'white' : '#333',
              border: '1px solid #ddd',
              borderRadius: '5px',
              cursor: 'pointer'
            }}
          >
            Government Projects
          </button>
          <button 
            onClick={() => setActiveTab('private')}
            style={{
              padding: '10px 20px',
              margin: '0 10px',
              backgroundColor: activeTab === 'private' ? '#007bff' : '#f8f9fa',
              color: activeTab === 'private' ? 'white' : '#333',
              border: '1px solid #ddd',
              borderRadius: '5px',
              cursor: 'pointer'
            }}
          >
            Private Projects
          </button>
          <button 
            onClick={() => setActiveTab('specialized')}
            style={{
              padding: '10px 20px',
              margin: '0 10px',
              backgroundColor: activeTab === 'specialized' ? '#007bff' : '#f8f9fa',
              color: activeTab === 'specialized' ? 'white' : '#333',
              border: '1px solid #ddd',
              borderRadius: '5px',
              cursor: 'pointer'
            }}
          >
            Specialized Works
          </button>
        </div>

        <div className="section-content">
          {activeTab === 'government' && (
            <div>
              <h3>Government Road Construction Projects</h3>
              <p>We have extensive experience working with various government departments and have successfully completed numerous projects:</p>
              <ul style={{ marginTop: '1rem', paddingLeft: '2rem' }}>
                {governmentProjects.map((project, index) => (
                  <li key={index} style={{ marginBottom: '0.5rem' }}>{project}</li>
                ))}
              </ul>
            </div>
          )}
          
          {activeTab === 'private' && (
            <div>
              <h3>Private Sector Projects</h3>
              <p>Our expertise extends to private sector development with focus on quality and timely execution:</p>
              <ul style={{ marginTop: '1rem', paddingLeft: '2rem' }}>
                {privateProjects.map((project, index) => (
                  <li key={index} style={{ marginBottom: '0.5rem' }}>{project}</li>
                ))}
              </ul>
            </div>
          )}

          {activeTab === 'specialized' && (
            <div>
              <h3>Specialized Construction Works</h3>
              <p>We undertake specialized construction works with precision and expertise:</p>
              <ul style={{ marginTop: '1rem', paddingLeft: '2rem' }}>
                {specializedWorks.map((work, index) => (
                  <li key={index} style={{ marginBottom: '0.5rem' }}>{work}</li>
                ))}
              </ul>
            </div>
          )}
        </div>

        <div style={{ marginTop: '3rem', padding: '1.5rem', backgroundColor: '#e9f7ef', borderRadius: '8px' }}>
          <h3>Areas We Serve</h3>
          <p>We proudly serve in and around: <strong>Mettupalayam | Nilgris | Coimbatore | Tiruppur | Erode</strong></p>
        </div>
      </section>
    </div>
  );
};

export default Projects;
